async (f) => {
  const filter = {};

  if (f.title) {
    filter["title"] = {
      contains: f.title,
      mode: "insensitive",
    };
  }
  if (f.id_pengajar) {
    filter["t_logbook_status"] = {
      some: { id_user: parseInt(f.id_pengajar) },
    };
  }
  if (f.date) {
    filter["date"] = {
      gt: new Date(moment(f.date).startOf("day").toString()),
      lt: new Date(moment(f.date).add(1, "day").startOf("day").toString()),
    };
  }
  if (f.notes) {
    filter["notes"] = {
      contains: f.notes,
      mode: "insensitive",
    };
  }
  if (f.id_hospital) filter["id_hospital"] = parseInt(f.id_hospital);
  if (f.id_ppds) filter["id_user"] = parseInt(f.id_ppds);
  if (f.id_category) {
    filter["m_action_category"] = {
      is: { id: parseInt(f.id_category) },
    };
  }
  if (f.location) {
    filter["location"] = {
      contains: f.location,
      mode: "insensitive",
    };
  }

  const data = await db.t_logbook.findMany({
    orderBy: { date: "desc" },
    where:
      user.role === "staff"
        ? {
            id_action: local.m_action.id,
            t_logbook_status: {
              some: {
                id_user:
                  typeof id_user === "string" ? parseInt(id_user) : id_user,
              },
            },
            m_user: {
              is_show: true,
            },
            ...filter,
          }
        : params.id_semester === "action"
        ? {
            id_action: local.m_action.id,
            id_user: typeof id_user === "string" ? parseInt(id_user) : id_user,
            ...filter,
          }
        : {
            id_action: local.m_action.id,
            id_user: typeof id_user === "string" ? parseInt(id_user) : id_user,
            id_semester: Number(params.id_semester),
            verified: true,
            ...filter,
          },
    include: {
      t_logbook_status: {
        include: {
          m_action_role: { select: { identifier: true } },
          m_user: { select: { id: true, display_name: true } },
        },
      },
      m_action_category: true,
      m_hospital: {
        select: { name: true },
      },
      m_user: {
        select: {
          display_name: true,
        },
      },
    },
  });

  if (local.m_action.identifier === "bimbingan-operasi") {
    let result = _.groupBy(data, "m_action_category.name");
    let array = Object.entries(result).map((e) => ({
      name: e[0],
      child: e[1],
      id_category: e[1][0]["id_category"],
    }));
    let empty_category = await db.m_action_category.findMany({
      where: {
        id_action: Number(params.id_action),
        id_client: Number(user.id_client),
        id: {
          notIn: array.map((e) => e.id_category),
        },
      },
      orderBy: {
        id: "asc",
      },
    });
    empty_category.map((item) => {
      array.push({ name: item.name, child: [], id_category: item.id });
    });
    console.log(empty_category, "ini empty_category");
    console.log(result, "ini result");
    console.log(array, "ini array");
    return array;
  }

  return data.map((item) => {
    const roles = { peserta: item.m_user.display_name };
    for (const o of item.t_logbook_status) {
      roles[o.m_action_role.identifier] = o.m_user.display_name;
    }

    let hospital = item.m_hospital?.name;

    return {
      id: item.id,
      date: moment(item.date).format("DD MMMM YYYY - HH:mm"),
      status: item.verified ? "Verified" : "-",
      title: item.title,
      ...roles,
      hospital,
      location: item.location,
    };
  });
}

